import React from 'react';

function Dashboard() {
  const token = localStorage.getItem('token');

  if (!token) return <p>Please login to view this page.</p>;

  return (
    <div>
      <h2>Welcome to the Dashboard</h2>
      <p>Your token: {token}</p>
    </div>
  );
}

export default Dashboard;
